import React, { Component } from 'react'

export class List extends Component {
    left="<";right=">";
  render() {
    return (
      <div id="container">
        <div className="groups" >Group 1<select multiple id="group1" size="10" ><option>AJAX</option><option>JQuery</option><option>Javascript</option><option>MooTools</option><option>Prototype</option><option>Dojo</option></select></div>
        <div id="buttons"><button>{this.right}</button><button>{this.left}</button></div>
        <div className="groups" >Group 2<select id="group2" size="10" ><option>ASP.net</option><option>C#</option><option>VB.net</option><option>Java</option><option>PHP</option><option>Python</option></select></div>
      </div>
    )
  }
}

export default List
